import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'
import utilStyles from '../styles/utils.module.css'
import Link from 'next/link'
import Date from '../components/date'
import { GetStaticProps } from 'next'
import Header from '../components/header'

import AboutContainer from '../components/aboutContainer/aboutContainer'

import styles from './page_styles/about.module.scss'
import React from 'react'
import TimeLine from '../components/aboutContainer/timeLine'
import ResponsiveComponent from '../components/responsiveComponent/responsive';
import Skills from '../components/aboutContainer/skills'

const bio: String = 'dfsfd';


export default function Home({
  allPostsData
}: {
  allPostsData: {
    date: string
    title: string
    id: string
  }[]
}) {
  return (

    <Layout home>

      <Head>
        <title>{siteTitle}</title>

      </Head>
      <div className={styles.mainContainer}>

        {AboutContainer({
          img_url: "/images/IMG_2112.jpg",
          position1: 50,
          position2: 70,
          children: [
            <div>
            
            {ResponsiveComponent([
              <div style={{display: "flex"}}>
              <a target="_blank">
              <img src="/images/profile.jpg" style={{float:"left",width:"10rem",height:"10rem",borderRadius:"10rem"}}></img>
                        </a>
                        <div style={{margin: "0 auto",width:"40rem",color:'white',fontSize:'18px',textAlign:'left',textShadow: '2px 2px 5px rgba(65, 65, 65, 0.6)',float:'right'}}>
                Yu Hang Ang, 22, an final year computer science student from Monash University Malaysia. 
                  
                </div>
                  </div>
              
            ]
              )

          }
</div>
          



              

          

          ]
        })}
        {ResponsiveComponent([
          <TimeLine
            title="Experiences"
            items={[
              {
                dateTime: "7/2020 - 8/2020", title: "Personal Website Development", link: '/about'
              },
              { dateTime: "4/2019 - 6/2020", title: "Flutter Application Development", link: '/' },
              { dateTime: "11/2019 - 2/2020", title: "Summer Internship", link: null },
              { dateTime: "1/3/2018", title: '"Hello World!"', link: null }
              ]}
          />
        ,
        <Skills></Skills>
      ])}


      </div>








    </Layout>
  )
}
